import React from "react";
import { useSelector } from "react-redux";
import Button from "./Button";
import { selectButtons } from "../store/buttonSlice";

const Navbar = () => {
  const buttons = useSelector(selectButtons);

  return (
    <nav className="bg-gray-800 text-white px-4 py-2 flex justify-center shadow-md space-x-4">
      {buttons.map((button) => (
        <Button
          key={button.id}
          text={button.text}
          color={button.color}
          onClick={button.onClick}
        />
      ))}
    </nav>
  );
};

export default Navbar;
